'''《失业偶像》'''是画师'''[[蛆娘|蛆虫音POI]]'''的漫画作品。目前在新浪微博不定期连载中。{{黑幕|[[畫個xx硬说是oo|画女非说男]]的典型作品。}}

主笔前期为蛆娘自己，后改为aya酱。目前处于不定时拖更中。

== 故事内容 ==
这是两个30岁左右的男孩子，因为没有社会经验和工作，不得不成为偶像的故事。

== 登场人物 ==
* '''{{Rubyh|[[苑方]]|李元芳}}'''
称号：线上最强的退役职业玩家

多年前风靡全球的音乐对战游戏“DORA2”的线上职业玩家，但从不打线下赛。游戏热度退去后，无法转型打其他强调线下赛的游戏，因此退役，现年30岁。由于长期家里蹲缺乏锻炼和社会阅历，无法找到工作。被父母强行遣送去琪妮安的事务所当偶像……

