* '''{{Rubyh|[[任倢]]|狄仁杰}}'''
称号：无所不晓的博士后

认为“只要读书就能不用去工作”，为了逃避进入社会而一路考上博士后，毕业后无路可逃了。32岁，没有任何工作经验，身型弱不禁风，几乎无法从事任何工作，无奈之下被弟弟介绍去琪妮安的事务所当偶像。

