== 作者的话 ==
* 说好今天公布的连载信息和角色设定……叫《失业偶像》，讲的是两个没有社会工作经验的……男孩子（咦？）被迫去当偶像的故事……个人连载，在本人的微博上发布，角色设计故事构成描线上色全部是自己完成，所以大家体谅下。近期会有更多设定信息放出哟~

* 本漫画制作只有我自己一个人业余画，没有[[Ocarina|笛子]]那样的神级助手，所以可能会因为现实工作问题[[拖更]]停更……但万一像本周那样生病和事多，咱尽量更些有意思的东西上来。{{黑幕|后来还是抓到美少女漫画家阿雅老师负责作画了}}

* 最初构想的时候，本来是两个妹子的故事，不过后来看到这图，我就想，要是两个长得超可爱，性取向又是异性的男孩子住一起久了，会不会不可避免的发生这种情况……的想法把现在的故事弄成了两个男孩子。。。
